/*Table structure for table `funcionalidades` */

DROP TABLE IF EXISTS `funcionalidades`;

CREATE TABLE `funcionalidades` (
  `id` int(11) NOT NULL,
  `titulo` varchar(255) DEFAULT NULL,
  `descricao` longtext,
  `classificacao` longtext,
  `horas_des` int(11) DEFAULT NULL,
  `horas_homolog` int(11) DEFAULT NULL,
  `valor_percebido` int(11) DEFAULT NULL,
  `preferencias` varchar(255) DEFAULT NULL,
  `comentario` longtext,
  `funcionalidade` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `funcionalidades` */

