insert  into `funcionalidades`(`id`,`titulo`,`descricao`,`classificacao`,`horas_des`,`horas_homolog`,`valor_percebido`,`preferencias`,`comentario`,`funcionalidade`) values (1,'AVC Linux','AVC com detecção, para redundância e auditoria (requer outra CPU com Linux).','Venda',1500,0,10,'','','NA'),(2,'AVC Rabbit','AVC simples, sem controle de detecção, apenas de periféricos.','Padrão',1000,0,10,'','','NA'),(3,'Aviso de Valor Máximo em Caixa na Pista','O CV avisa ao arrecadador quando um determinado valor (configurado) for atingido em pista (baseado nas tarifas das categorias classificadas). O CV não informa o valor ao arrecadador, por segurança.','Padrão',32,0,7,'','Configurações de pista no SA:','NA'),(4,'Check List do processo de apuração de resultados','Funcionalidade que fornece uma lista de verificações que devem ser feitas pelo sistema, com o objetivo de auxiliar o operador no processo de Apuração de Resultados.','Padrão',80,0,10,'76','','NA'),(5,'Check list operacional de um período','Funcionalidade que fornece uma lista de verificações que devem ser feitas pelo sistema, com o objetivo de auxiliar o operador no processo de fechamento do período, para emissão de relatórios para informação das áreas financeira e contábil.','Padrão',80,0,10,'79','','NA'),(6,'Integração Visa Vale Pedágio','Integração com a VISA para o meio de pagamento VISA Vale Pedágio.','Venda',1800,0,9,'10004','','NA'),(7,'Contagem de Eixos com Sensores de Rodagens','Redundância: o algoritmo de detecção de veículos é capaz de detectar quantidade de eixos, utilizando os sensores de rodagem.','Venda',180,16,6,'','Depende do AVC Linux','NA'),(8,'Declaração, Sangria e Malote na Pista','Permite realizar no CV todo o processo de declaração de fim de turno e de sangrias parciais.','Venda',640,32,7,'','','NA'),(9,'Eixos Suspensos','Depende da Geometria de Pista:','Venda',120,0,8,'','Consultar o relatório de hardware','NA'),(10,'Exibir Tempo de Atendimento para o Arrecadador','Exibe na interface principal do CV o tempo de atendimento.','Padrão',8,0,7,'','Configurações de pista no SA','NA'),(11,'Ferramentas para Apoio à Manutenção da Pista','IODig e Analisa Sensores - Aplicativos para auxílio na manutenção da pista.','Padrão',240,0,9,'','','NA'),(12,'Informações de Transações Automáticas na Interface de Pista','O CV, operando em modo automático, exibirá em sua interface os dados da transação: status, meio de pagamento, número da mídia, emissor, placa, categoria da mídia.','Padrão',80,0,8,'','','NA'),(13,'Integração Vale Pedágio Cupom DTRANS','Integração com o Meio de Pagamento: Vale Pedágio Cupom DBTRANS.','Venda',450,40,9,'69, 70, 71, 92','Preencher:','NA'),(14,'Isentos de Passagens Múltiplas (ISPM)','Conforme legislação do Rio Grande do Sul.','Venda',540,0,10,'80, 84, 4061, 4062, 4028','','NA'),(15,'Nível 4 – BI.','Ferramenta de BI, com construção de data warehouse, para análise dos dados. Permite a adaptação em relatórios já existentes na ferramenta e a criação de relatórios e dashboards novos com consultoria da COMPSIS.','Venda',580,0,9,'','Instalar data warehouse, ferramenta da Microstrategy etc.','NA'),(16,'Notificação de Eventos Críticos de Pista por e-mail','A CS envia um e-mail com mensagem de alerta para um determinado número (ou percentual) de ocorrências de falha. A configuração das ocorrências que serão monitoradas pela CS deve ser feita no SA.','Venda',280,24,9,'','Tabelas: GrupoEventoPista, GrupoMensagens','NA'),(17,'Notificação de Falhas de Comunicação com a Pista por e-mail','A CS monitorará a comunicação com as pistas e enviará um e-mail conforme configurado nos casos:','Venda',280,24,9,'','','NA'),(18,'Operação em Modo Degradado','O sistema de pista detecta falhas em sensores e avisa na CS e no SA (Correção de Transações) que a pista está em modo degradado.','Venda',200,24,7,'86','Habilita o envio das transações com falha de equipamento para correção?','NA'),(19,'Portal SICAT para uma Concessionária','Para a solução multipraças descentralizada (com replicação SQLServer), há uma aplicação que funciona como um \"portal\", permitindo o acesso a todos servidores de aplicações do SGAP. Esta aplicação permite que os operadores façam um login único e acessem os servidores das praças, desde que o mesmo operador esteja cadastrado com a mesma senha em todas as aplicações.','Venda',400,0,4,'','','NA'),(20,'Recebimento em TAG em Pista Manual','Permite o meio de pagamento Via Fácil / Sem Parar na pista manual, para tags cadastrados e liberados.','Venda',220,24,9,'66','Configurações de Pista no SA','NA'),(21,'Registro de Conferência de Malotes','Aplicativo para ser utilizado pela transportadora de valores ou agente conferente de malotes para declarar os valores conferidos nos malotes e gerar o arquivo para depósito no SA.','Venda',400,0,8,'','','NA'),(22,'Isentos ALESP','Lista de veículos da Assembléia Legislativa de São Paulo, isentos com tag CGMP, controlados pelo grupo CCR. Não possui arquivo padronizado, se houver uma lista, deverá ser incluída no sistema manualmente ou via script.','Padrão',400,0,8,'','Veículos criados via script (por enquanto)','NA'),(23,'Integração Auto Expresso DBTRANS','Integração com o meio de pagamento AVI da DBTRANS.','Venda',1400,24,8,'36, 37, 59, 60, 61','','NA'),(24,'Cadastro de Usuários que Pagam com Cheque','Possibilita o cadastro dos emissores de cheque (CPF ou CNPJ) no SA, indicando a situação: devedor, reabilitado ou liberado.','Padrão',200,0,6,'49','Haverá validação do dígito verificador do CPF?','15'),(25,'Exportação de Dados para OHL','Automatização da exportação dos arquivos para a Holding (OHL).','Venda',400,0,9,'85, 89, 4050, 4051','','23'),(26,'Sistema de Arquivamento','Permite o apagamento dos dados brutos após período bloqueado.','Padrão',400,0,6,'','','26'),(27,'Venda de Cupons','Permite retirada de cupons para venda e devolução de cupons não vendidos.','Padrão',400,0,6,'','','27,84,85'),(28,'Revisão de Transações','Uma correção de transação que gerou dívida para o arrecadador pode ser revisada, concedendo um crédito para o arrecadador, no valor da transação. A transação não é alterada, apenas é concedido um abono ao arrecadador.','Padrão',240,0,5,'14','A dívida deverá ser transferida para o supervisor que corrigiu a transação?','61'),(29,'Verificação de Transações','Interface para verificação das transações com foto (transações que tiveram discrepância ou anomalia).','Padrão',240,0,10,'','','62'),(30,'Visualização das Ocorrências de Sensores e Periféricos de Pista','As ocorrências geradas nas pistas e apresentadas na CS são disponibilizadas em interface e relatório no SA.','Padrão',240,0,10,'','','76,103'),(31,'Verificação de Transações Normais','Interface para verificação das transações que não tiveram nenhuma discrepância ou anomalia.','Padrão',240,0,10,'','','77'),(32,'Responsável por Pista Automática: tratamento das violações em pista automática.','Responsável por Pista Automática: violação em pista automática podendo ser quitada na Correção de Transações. O Responsável por Pista recebe em dinheiro na pista e deve declarar este valor.','Padrão',400,0,8,'4','','78'),(33,'Controle de Velocidade','Integração com sistema de identificação de velocidade; captura da imagem do veículo se velocidade acima de um limite configurado.','Venda',300,24,8,'','Haverá detecção da velocidade','79'),(34,'Usuário Local','Permite o cadastro de veículos (placas) que receberão desconto na tarifa.','Padrão',500,0,8,'20','','86'),(35,'Isentos ARTESP','Carrega arquivo padronizado com a lista dos isentos da ARTESP.','Padrão',400,0,8,'21, 4058','','87'),(36,'Controle do Histórico de Cadastros de Pista','Interface no SA com indicação da data e hora de disponibilização de todos os cadastros pelo SA, leitura pela FA, pela CS e por cada uma das pistas.','Venda',800,24,9,'53','','88,1088'),(37,'Isentos EDITAL','Carrega arquivo padronizado com uma lista de veículos isentos por Edital.','Padrão',400,0,7,'22','Foi usado em Colinas','89'),(38,'Correção de Transações em Lote','Permite selecionar um grupo de transações e aplicar a correção em todas de uma vez:','Padrão',80,0,7,'68','','90'),(39,'Inserção Manual AVI','Padrão para Concessionária que tem pista AVI CGMP.','Venda',340,0,8,'63','Padrão, quando houver o meio de pagamento Via Fácil / Sem Parar','95'),(40,'Pré-Correção de Transações','Neste módulo é possível visualizar todas as informações das transações, porém, permite inserir uma observação às transações que estão disponíveis para Correção Definitiva. Esta observação estará visível na Correção Definitiva, porém não poderá ser alterada.','Venda',380,24,7,'54','Após a inclusão da observação, a transação deve continuar a ser exibida na interface de Pré-Correção?','97'),(41,'Exportação de transações para auditoria','Permite exportar em arquivo que pode ser aberto em Excel, uma lista das transações ocorridas em determinado período e pista, com todos os detalhes como categorias, eixos, meio de pagamento etc.','Padrão',120,0,10,'','','101'),(42,'Controle de isentos por conta','Os veículos isentos devem estar associados a uma conta isenta, para gerenciamento de dados pessoais ou empresariais.','Venda',400,0,7,'','','105,106,107,108,110,111,112,113,114,115'),(43,'Usuários de Crédito Concedido','Permite cadastrar os usuários que tem crédito concedido no pedágio.','Venda',400,16,7,'78','','109'),(44,'Emissão de Promessa de Pagamento em Pista (Voucher)','Recebimento de Promessa de Pagamento (Voucher) para Não Pagantes e Violações.','Venda',600,16,7,'','','121'),(45,'Exportação de Dados para ERP','O SA pode gerar um arquivo texto, em formato pré-acordado, com informações do fechamento financeiro/contábil.','Venda',840,0,9,'4039, 4041','Necessário negociar o modelo do arquivo.','122'),(46,'Desconto por Intervalo de Tempo (Time Envelop)','Não convive com outros controles de descontos.','Venda',600,0,7,'50','Não habilitar se já houver outros controles de descontos.','123'),(47,'Inserção Manual de Transações por Meio de Pagamento','O sistema permite a inserção manual de qualquer meio de pagamento, exceto cartões de crédito ou débito, desde que configurado, para qualquer pista da praça em questão.','Não habilitar',0,0,0,'','','124'),(48,'Nível 4 – Replicação SQL Server','Sistema de acompanhamento, via Internet, de toda a gestão da arrecadação de pedágios. O servidor do Nível 4 tem acesso via rede aos servidores dos bancos de dados e à CS principal de todas as praças, permitindo acesso a um conjunto reduzido de funcionalidades, como emissão de relatório, consulta a dados para auditoria sobre as operações, visualização do sinótico das pistas de uma praça, visualização gráfica do tráfego diário registrado, de modo semelhante ao da CS.','Não habilitar',0,0,0,'55','','126'),(49,'Configuração de Categorias no SA','Nunca vender.','Não habilitar',0,0,0,'','','127'),(50,'Configurações de Pista Feitas no Sistema Administrativo','Permite algumas configurações de pistas em interface do SA, com a descida de um cadastro destas configurações para uso nas pistas. Assim, possibilita a configuração do mesmo item para diversas pistas ao mesmo tempo.','Padrão',700,0,10,'','','128'),(51,'Monitoramento dos Eventos da Interoperação com o CGMP','Envio de e-mail pelo SA para ocorrência de erro nos eventos da interoperabilidade CGMP (recebimento de cadastros, geração de lotes, envio de lotes, recebimentos de protocolos); envio de e-mail pelo SA para cadastros CGMP desatualizados no SA (leva em consideração a frequência de atualização configurada); e-mail pela CS para cadastros desatualizados nas pistas.','Venda',120,24,9,'','Depende do meio de pagamento Via Fácil / Sem Parar','129,130'),(52,'Acompanhamento de VDA','O sistema monitora as dívidas dos operadores e quando elas passam de um determinado período sem serem quitadas, um e-mail é enviado, conforme configurações, para o responsável.','Venda',140,32,7,'102','','131,1136'),(53,'Importação dos Arquivos do CGMP de Descontos da Taxa de Manutenção','Necessário módulo de integração com Via Fácil / Sem Parar. Somente para sistema centralizado.','Venda',480,16,7,'104, 105, 106, 107','','132,133,1150,1153,1154'),(54,'Integração com o Vale Pedágio Sem Parar','Importação dos arquivos de passagem comprada e realizada de vale pedágio. Os relatórios 1114, 1115 e 1116 acompanham este módulo.','Venda',250,0,8,'','Habilitar parâmetro 4 do relatório 1044','3013,1114,1115,1116'),(55,'Configuração das Mensagens de pista por código do status do tag.','Permite configurar uma mensagem para o ITSL para cada status de tag, por meio de pagamento.','Venda',120,0,8,'','Padrão, para quem tiver um meio de pagamento AVI.','3014'),(56,'Controle de Descontos AVI - Auto Expresso DBTRANS','Necessário ter o módulo de integração com Auto Expresso Dbtrans.','Venda',1800,56,8,'45','Informar o percentual de correção automática das mídias do controle de desconto:','3015,3016'),(57,'Controle de Descontos AVI - Via Fácil / Sem Parar','Necessário ter o módulo de integração com Via Fácil / Sem Parar.','Venda',1800,56,8,'45','Informar o percentual de correção automática das mídias do controle de desconto:','3015,3016'),(58,'Integração AVI Via Fácil / Sem Parar - CGMP','Integração com o meio de pagamento do CGMP: Via Fácil / Sem Parar','Venda',2000,0,10,'','','');

